    return (
        <nav className="navbar navbar-expand-lg navbar-dark bg-dark text-center pt-1 pb-1">
            <div className="row">
                <div className="col-md-4">
                    <h2><a href="." className="text-white" id="app-name"> Friends Clicky Game </a> </h2>
                </div>
                <div className="col-md-4">
                <h2>Click an image to start the game! </h2>
                </div>
                <div className="col-md-4">
                <h2>Scores: </h2>
                </div>
            </div>
        </nav>
    );
}

export default Navbar;
